			<h1
				class="text-2xl font-bold text-white text-lg font-medium tracking-tight sm:text-4xl text-center max-w-2xl mx-auto"
			>
            The story of Sahha
			</h1>
			<div class="text-6xl text-white text-center mt-8" style="font-family: ui-serif;">صحة</div>
			<!-- <p class="mt-2 text-base text-gray-400 py-4 max-w-2xl mx-auto text-center md:block hidden">
				Empowering healthcare providers with behavioral analytics that delivers meaningful engagement & evidence-based treatments
			</p> -->
		</div>

		<div class="mt-6 prose prose-indigo prose-lg text-gray-200 mx-auto max-w-2xl md:pb-32 pb-10">
			<p>
				In Arabic, Sahha represents health, welfare, and strength. In one word, these are the principles we value in ourselves, in our customers, and in our customers’ users.
			</p>
			<br>

			<p>
				Sahha’s mission is simple:
			</p>		
			<br>
			<p class="max-w-xl">
				<i class="md:text-2xl text-lg font-medium">Deliver better mental health data to providers so they can deliver better care to patients </i>	 
			</p>
			 <br>
			 <p>
				When combined with the values of health, welfare, and strength, Sahha achieves this mission through its core operating principles:		
			</p>
			<br>
			<p>
			  <span class="underline underline-offset-1">Evidence based</span> - Only use data that is backed by clinical research and supported by science.
			</p>
			<br>
			<p>
			  <span class="underline underline-offset-1">Privacy by design</span> - Collect no personal information and use behavioral signals that cannot be used for identification.
			</p>
			<br>
			<p>
			  <span class="underline underline-offset-1">Purposeful engagement</span> - Focus on user experiences that help someone learn more about themselves and take actions to improve.
			</p>
			<br>
			<p>
				Large social media and search engine companies collect personal data with the end goal of improving consumerism. What if it was used to improve mental health instead? And could be done without the data being personal?
			</p>
